'use strict';
let MessageType = require('./MessageType.js');
class ChangeOrderMessage {
    error;
    requestTxt;
    orderId;
    constructor() {
        this.error = null;
        this.requestTxt = null;
        this.orderId = null;
    }
    getError() {
        return this.error;
    }
    getType() {
        return MessageType.ChangeOrder;
    }
    getRequestTxt() {
        return this.requestTxt;
    }
    getOrderId() {
        return this.orderId;
    }
}
module.exports = ChangeOrderMessage
